import { Link } from "react-router-dom";
import pic from ".2748558.png";

const NotFound = () => {
    return ( 
        <div className="notfound">
            <h1>hey !! NotFound !!!!404  </h1>
            <img src= {pic}></img>
            <Link to ="/">Go back to HomePage </Link>
        </div>
     );
}
 
export default NotFound;
